# 반복문 안에 삽입해서 크래시 방지 / esc 키로 프로그램 종료
def prevent_crash(enable_exit = True):
    for event in pygame.event.get():
        if event.type == pygame.QUIT:
            pygame.quit()
        if enable_exit == True:
            if event.type == pygame.KEYDOWN:
                if event.key == pygame.K_ESCAPE:
                    sys.exit()

# 화면상에 텍스트 띄우는 함수
def blit(message1, fontSize, coord, color, condition = False, mode = "center", Font = "C:/Pygame_fonts/SourceCodePro-VariableFont_wght.ttf"):
    font = pygame.font.Font(Font, fontSize)
    text = font.render(str(message1), True, color)
    textRect = text.get_rect()
    exec(f"textRect.{mode} = (coord[0], coord[1])")
    screen.blit(text, textRect)
    if condition: pygame.display.update()

# 암호화 해주는 함수
def encode(message1):
    code = [[] for _ in range(10)]

    code[0] = message1

    for i in range(len(code[0])):
        code[1].append(bin(ord(code[0][i]))[2:].zfill(18))
    code[1] = "".join(code[1])

    for i in range(len(code[1])):
        if i%2 == 0:
            if code[1][i] == "0": code[2].append("1")
            else: code[2].append("0")
        else: code[2].append(code[1][i])
    code[2] = "".join(code[2])

    for i in range(len(code[2])-1, -1, -1):
        code[3].append(code[2][i])
    code[3] = "".join(code[3])

    for i in range(0, len(code[3]), 3):
        code[4].append({
            "000": "6",
            "001": "4",
            "010": "8",
            "011": "3",
            "100": "5",
            "101": "2",
            "110": "1",
            "111": "9",
        }["".join(code[3][i:i+3])])
        if random.randrange(0, 10) == 0: code[4].append("0")
        if random.randrange(0, 10) == 0: code[4].append("7")
    code[4] = "".join(code[4])
    code[4] += "0"*(6-len(code[4])%6 if len(code[4])%6 != 0 else 0)

    for i in range(0, len(code[4]), 6):
        code[5].append(numpy.base_repr(int("".join(code[4][i:i+6])), 36).zfill(4))
    code[5] = "".join(code[5])

    for i in range(0, len(code[5]), 2):
        code[6].append(code[5][i+1])
        code[6].append(code[5][i])
    code[6] = "".join(code[6])

    for j in range(len(code[6])):
        if code[6][len(code[6])-j-1] != "0": break
    code[7] = code[6][:-1*j] + str(j)
    if j == 0: code[7] = copy.deepcopy(code[6]) + "0"

    code[8].append(code[7][0])
    for i in range(len(code[7])-1):
        code[8].append(numpy.base_repr(ord(code[7][i]) - ord(code[7][i+1]), 36))
    code[8] = " ".join(code[8])

    temp = list(code[8].split())
    two = []
    for i in range(len(temp)):
        t = copy.deepcopy(temp[i])
        if t[0] == "-":
            a = [str(i) for i in range(10)]
            b = [")", "!", "@", "#", "$", "%", "^", "&", "*", "("]
            for i in range(10):
                t = t.replace(a[i], b[i])
            for i in range(65, 91):
                t = t.replace(chr(i), chr(i+32))
            code[9].append(t[1:])
        else: code[9].append(t)
    for i in range(len(code[9])):
        if len(code[9][i]) >= 2: code[9][i] = ["[", "]", ";", ".", "/", "<", ">"][random.randrange(7)] + code[9][i]
    code[9] = "".join(code[9])

    return code[9]

# 복호화 해주는 함수
def decode(message1):
    code = [[] for _ in range(10)]

    code[0] = message1

    i = -1
    while True:
        i += 1
        try:
            if code[0][i] not in ["[", "]", ";", ".", "/", "<", ">"]:
                code[1].append(code[0][i])
            else:
                code[1].append(code[0][i+1:i+3])
                i += 2
        except: break
    code[1] = " ".join(code[1])

    temp = list(code[1].split())
    for i in range(1, len(temp)):
        if temp[i] in [chr(i) for i in range(65, 91)] or "1" in temp[i]:
            code[2].append(str(int(temp[i], 36)))
        elif temp[i] in [chr(i) for i in range(97, 123)]:
            code[2].append("-" + str(int(temp[i].upper(), 36)))
        elif temp[i].isdigit():
            code[2].append(temp[i])
        else:
            t = copy.deepcopy(temp[i])
            a = [str(i) for i in range(10)]
            b = [")", "!", "@", "#", "$", "%", "^", "&", "*", "("]
            for j in range(10):
                t = t.replace(b[j], a[j])
            code[2].append("-" + str(int(t, 36)))
    code[2] = " ".join(code[2])

    temp = list(map(int, code[2].split()))
    code[3].append(code[0][0])
    for i in range(len(temp)):
        code[3].append(chr(ord(code[3][-1]) - temp[i]))
    code[3] = "".join(code[3])
    code[3] = code[3][:-1] + "0"*int(code[3][-1])

    for i in range(0, len(code[3]), 2):
        code[4].append(code[3][i+1])
        code[4].append(code[3][i])
    code[4] = "".join(code[4])

    for i in range(0, len(code[4]), 4):
        code[5].append(str(int(code[4][i:i+4], 36)).zfill(6))
    code[5] = "".join(code[5])

    while code[5][-1] == "0":
        code[5] = code[5][:-1]

    for i in range(len(code[5])):
        if code[5][i] in ["0", "7"]: continue
        
        if code[5][i] == "1": code[6].append("110")
        if code[5][i] == "2": code[6].append("101")
        if code[5][i] == "3": code[6].append("011")
        if code[5][i] == "4": code[6].append("001")
        if code[5][i] == "5": code[6].append("100")
        if code[5][i] == "6": code[6].append("000")
        if code[5][i] == "8": code[6].append("010")
        if code[5][i] == "9": code[6].append("111")
    code[6] = "".join(code[6])

    for i in range(len(code[6])-1, -1, -1):
        code[7].append(code[6][i])
    code[7] = "".join(code[7])

    for i in range(len(code[7])):
        if i%2 == 0:
            if code[7][i] == "0": code[8].append("1")
            else: code[8].append("0")
        else: code[8].append(code[7][i])
    code[8] = "".join(code[8])

    for i in range(0, len(code[8]), 18):
        code[9].append(chr(int(code[8][i:i+18], 2)))
    code[9] = "".join(code[9])

    return code[9]

